double sigmoid(float x) {
    return 1.0 / (1.0 + exp(-x));
}

double relu(float x) {
    return fmax(0.0, x);
}

void conv1d(const float *input, short input_size, const float *filters, const float *bias, short filter_size, float *output, short num_filters) {
    int output_size = input_size - filter_size + 1;
    for (short f = 0; f < num_filters; f++) { // Duy?t t?ng b? l?c
        for (short i = 0; i < output_size; i++) { // Duy?t qua t?ng v? trí tích ch?p
            output[f * output_size + i] = bias[f]; // B?t đ?u b?ng giá tr? bias
            for (short j = 0; j < filter_size; j++) { // Th?c hi?n tích ch?p
                output[f * output_size + i] += input[i + j] * filters[f * filter_size + j];
            }
        }
    }
}

//maxpooling 1D
void maxpool1d(float *input, short input_size, short pool_size, float *output) {
    short output_size = input_size / pool_size;
    for (short i = 0; i < output_size; i++) {
        double max_val = -INFINITY;
        for (short j = 0; j < pool_size; j++) {
            max_val = fmax(max_val, input[i * pool_size + j]);
        }
        output[i] = max_val;
    }
}

