void setup_gpio(void) {
    gpio_config_t io_conf = {
        .pin_bit_mask = 1ULL << LED_PIN,
        .mode = GPIO_MODE_OUTPUT,
        .pull_up_en = GPIO_PULLUP_DISABLE,
        .pull_down_en = GPIO_PULLDOWN_DISABLE,
        .intr_type = GPIO_INTR_DISABLE
    };
    gpio_config(&io_conf);
}

void app_main(void)
{
    setup_gpio();
    // Cấu hình ADC
    adc_oneshot_unit_handle_t adc1_handle;
    adc_oneshot_unit_init_cfg_t unit_cfg = {
        .unit_id = ADC_UNIT_1,
    };

    ESP_ERROR_CHECK(adc_oneshot_new_unit(&unit_cfg, &adc1_handle));

    // Cấu hình kênh ADC
    adc_oneshot_chan_cfg_t channel_cfg = {
        .atten = ADC_ATTEN_DB_11, 
        .bitwidth = ADC_BITWIDTH_DEFAULT,
    };
    ESP_ERROR_CHECK(adc_oneshot_config_channel(adc1_handle, ADC_CHANNEL, &channel_cfg));

    ESP_LOGI(TAG, "Starting AD8232 monitoring...");
    float a[130];
    short i=0;
    while (1)
    {
        int raw_value = 0;
        ESP_ERROR_CHECK(adc_oneshot_read(adc1_handle, ADC_CHANNEL, &raw_value));
        ESP_LOGI(TAG,"%d", raw_value);
        if (i<128)
        {
            a[i]=raw_value;
            i++;
        }
        else
        {
            float *conv_output = malloc(NUM_FILTERS * (INPUT_SIZE - FILTER_SIZE + 1) * sizeof(float));
        conv1d(a, INPUT_SIZE, conv_filters, conv_bias, FILTER_SIZE, conv_output, NUM_FILTERS);

        float *pool_output = malloc(NUM_FILTERS * (INPUT_SIZE - FILTER_SIZE + 1) / POOL_SIZE * sizeof(float));
        for (short f = 0; f < NUM_FILTERS; f++) {
            maxpool1d(&conv_output[f * (INPUT_SIZE - FILTER_SIZE + 1)], INPUT_SIZE - FILTER_SIZE + 1, POOL_SIZE, &pool_output[f * (INPUT_SIZE - FILTER_SIZE + 1) / POOL_SIZE]);
        }

        float dense_output[HIDDEN_SIZE];
        for (short i = 0; i < HIDDEN_SIZE; i++) {
            dense_output[i] = dense_biases[i];
            for (short j = 0; j < 504; j++) {
                dense_output[i] += dense_weights[i][j] * pool_output[j];
            }
            dense_output[i] = relu(dense_output[i]);
        }

        float output = output_bias;
        for (short i = 0; i < HIDDEN_SIZE; i++) {
            output += output_weights[i] * dense_output[i];
        }
        output = sigmoid(output);

        short predicted_label = output >= 0.5 ? 1 : 0;
            /*************************************lan truyen thuan***************************************************/
            // Điều khiển LED
            if (predicted_label == 1) {
                gpio_set_level(LED_PIN, 1); // Bật LED
            } else {
                gpio_set_level(LED_PIN, 0); // Tắt LED
            }

            ESP_LOGI(TAG, "Output: %f, Predicted Label: %d", output, predicted_label);
            break;
        }

        vTaskDelay(pdMS_TO_TICKS(200)); // Đọc dữ liệu mỗi 100ms
    }

    // Hủy cấu hình ADC khi không cần thiết
    ESP_ERROR_CHECK(adc_oneshot_del_unit(adc1_handle));
}
